svg.script:
 var formulae = ["a^2 * sqrt(3)", "a^3 / (6sqrt(2))",
 "4(pi)r^2", "(4/3)(pi)r^3",
 "6a^2", "a^3"]
 var solidname = ["Tetrahedron", "Sphere", "Cube"]
 function changesolid(solid){
document.getElementById("solidtext").innerHTML = solidname[solid];
 }
 function changeformula(surfacearea, volume){
  document.getElementById("areatext").innerHTML = "Surface Area = " + formulae[surfacearea];
  document.getElementById("volumetext").innerHTML = "Volume = " + formulae[volume];
  }

